import React, { Component } from 'react'

class Nav extends Component {
    constuctor() {

      }

      homeButton = () => {
        this.props.history.push('/dashboard');
      }
      postButton = () => {
        this.props.history.push('/post');
      }
      logoutButton = () => {
        this.props.history.push('/');
      }

    render() { 

        return ( 
            <div>
                Nav
                <button
                    onClick={this.props.homeButton}> Home
                </button>
                <button
                    onClick={this.props.postButton}> New Post
                </button>
                <button
                    onClick={this.props.logoutButton}> Logout
                </button>
            </div>
         );
    }
}

export default Nav;
